import React from 'react';
import { Modal, Button } from "react-bootstrap";
import Heading from '../../../../Heading';
import {
    BiXCircle
  } from "react-icons/bi";


function Delete(props) {

    const skillID=props.skillID;
    const icon=props.icon;
    return (
        <>
        <p>{skillID} {icon} </p>
        <Modal
        {...props}
                    size="md"
                    scrollable
                    // show={showDelete}
                    // onHide={() => setShowDelete(false)}
                  >
                    <Modal.Header closeButton>
                      <Modal.Title>
                        <Heading
                          content="Delete Skill"
                          design="h4 my-auto"
                        />
                      </Modal.Title>
                    </Modal.Header>
                    <Modal.Body>
                    {/* <p> {dd} </p> */}
                      <p>Are you sure want to delete it?</p> {skillID}
                    </Modal.Body>
                    <Modal.Footer>
                      <Button
                        variant="secondary"
                        // onClick={() => setShowDelete(false)}
                      >
                        Close
                      </Button>
                      <Button
                        type="submit"
                        variant="primary"
                      >
                        Save Changes
                      </Button>
                    </Modal.Footer>
                  </Modal>
                  </>
    )
}

export default Delete
